function PopUpTweet({popUp}) {
    return <div className="popUp">
        <div className="PopUpTweet">
            <div>
                <FontAwesomeIcon icon={faXmark} onClick={() => popUp()}/>
            </div>
            <div>
                <FontAwesomeIcon icon={faTrashCan}/>
                <div>Supprimer le tweet</div>
            </div>
        </div>  
    </div>


}
